import React from "react";
export default class Coin extends React.Component{

    constructor(props){
        super(props)
        this.state = {
            coins : []
        }
        
    }
   
   async componentDidMount(){
    var myHeaders = new Headers();
    myHeaders.append("Authorization", "Bearer "+localStorage.getItem('token'));
    var raw = "";
    
    var requestOptions = {
      method: 'GET',
      headers: myHeaders,
      body: raw,
      redirect: 'follow'
    };
    
    fetch("http://localhost:8089/api/coin/getAllCoin", requestOptions)
      .then(response => response.text())
      .then(result => {
        this.setState({
            coins:result
        })  
        console.log(result)})
      .catch(error => console.log('error', error))
    }
    render(){
        return (
            <div> 
            <h1>Coin List</h1>  
                <table className="table table-hover">
                    <thead>
                        <tr>
                            <th>CoinId</th>
                            <th>CoinName</th>
                            <th>Price</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                        this.state.coins.map(
                        coin =>
                        <tr key = {coin.coinId}>
                            <td>{coin.coinId}</td>
                            <td>{coin.coinName}</td>
                            <td>{coin.price}</td>
                        </tr>
                            )
                        }
                    </tbody>
            </table>
   </div>

        )
       
    }
}
